import React from "react";
import classes from './Post.module.css';

interface PostInterface {
    posts: object;
}

const Post: React.FC<PostInterface> = (props) => {
    return (
        <div className={classes.Post}>
            <p>{ props.p }</p>
        </div>
    );
}

export default Post
